import React from 'react';
import { Route, Switch } from 'react-router-dom';

import Home from './pages/Home';
import Projects from './pages/Projects';
import Activities from './pages/Activities';

//projects
import Ballpit from './pages/Ballpit.js';
import Vivi from './pages/Vivi.js';
import IPot from './pages/Ipot.js';
import BallRobot from './pages/Ballrobot.js';

class Routes extends React.Component {
  render() {
    return (
      <Switch>
        <Route exact path='/' component={Home} />
        <Route exact path='/projects' component={Projects} />
        <Route exact path='/activities' component={Activities} />

		//projects
        <Route exact path='/projects/virtual-ballpit' component={Ballpit} />
        <Route exact path='/projects/vivi-cosplay' component={Vivi} />
        <Route exact path='/projects/ipot-lite' component={IPot} />
        <Route exact path='/projects/turtle-ball-dispens' component={Vivi} />
        <Route
          render={function() {
            return <h1>Not Found</h1>;
          }}
        />
      </Switch>
    );
  }
}

export default Routes;
